var actualize_boss_infos = function(ship, text) {
  bosses.components[0].value = text;
  ship.setUIComponent(text);
}


var healing = function(ship) {
  var l = [10,42]
  if (ship.crystals >= 300) {
    for (g=0;g<2;g++) {
      game.addCollectible({
        x: ship.x,
        y: ship.y, 
        code: 91
      })
    }
    game.addCollectible({
      code:l[~~(Math.random()*l.length)],
      x: ship.x,
      y: ship.y, 
    })
    ship.setUIComponent({id:"heal", visible:false})
  } else {
    ship.set({
      shield:ship.shield - Math.trunc(ship.tier / 100) * 20
    })
  }
};


this.event = function(event, game) {
  let ship = event.ship;
  let alien = event.alien;
  let killer = event.killer;
  switch (event.name)
  {
    case "alien_destroyed":
      if (alien !== null)
      {
        if (alien.code === 12) {
          game.custom.aliens--;
        };
        if (killer !== null) {
            if (alien.code !== 12) {
              if (killer.team === 0) {
                game.custom.team_score_1 += 100;
                killer.custom.points += 100;
              } else {
                game.custom.team_score_1 += 100;
                killer.custom.points += 100;
              }
            }
            else if (alien.code === 12) {
             if (killer.team === 0) {
                game.custom.team_score_1 += 3000;
                killer.custom.points += 3000;
              } else {
                game.custom.team_score_1 += 3000;
                killer.custom.points += 3000;
              }
            }
        }
      }
      break ;
    case "ship_destroyed":
      if (ship !== null) {
          if (ship.team === 0) {
            if (game.custom.team_score_1 - Math.trunc(ship.tier / 100) >= 0) {
              game.custom.team_score_1 -= Math.trunc(ship.tier / 100)
              ship.custom.points -= Math.trunc(ship.tier / 100);
            } else {
              game.custom.team_score_1 = 0;
              ship.custom.points -= Math.trunc(ship.tier / 100);
            }
          } else {
            if (game.custom.team_score_2 - Math.trunc(ship.tier / 100) >= 0) {
              game.custom.team_score_2 -= Math.trunc(ship.tier / 100)
              ship.custom.points -= Math.trunc(ship.tier / 100);
            } else {
              game.custom.team_score_2 = 0;
              ship.custom.points -= Math.trunc(ship.tier / 100);
            }
          }
        if (killer !== null) {
          if (killer.team === 0) {
            game.custom.team_score_1 += Number(100)
            killer.custom.points += 350;
          } else {
            game.custom.team_score_2 += Number(100)
            killer.custom.points += 350;
          }
        }
      }
      break;
    case "ui_component_clicked":
      switch (event.id) {
        case "heal":
          healing(ship);
      }
          break;
          
  }
};




